INSERT INTO `dynamic_page` (`id`, `title`, `slug`, `content`, `priority`, `status`, `show_on`, `created_at`, `updated_at`) VALUES
(1, 'Advertisement', 'advertisement', '<h1><u style=\"color: rgb(0, 97, 0);\">Advertisement                                  </u></h1><p>As per the latest National Media Survey (NMS 2018 of Kantar MRB), 6.6 million people read the print edition of Prothom Alo every day, and it is the highest readership number among all Bangladeshi newspapers. Prothom Alo does not only have the widest reader base as a whole, but it also reaches to the most erudite readers of Bangladesh belonging to the upper SEC (Socio Economic Class). Prothom Alo is way ahead of any other newspaper in reaching key target groups of readers.</p><p>prothomalo.com is the “Number 1” Bangladeshi as well as Bengali Language website in the world based on traffic and pageviews. Around 12 million users access this portal every month from over 200 different countries and territories. They generate around 280 million pageviews per month. Through all digital platforms, Bengali and English portals and mobile apps, Prothom Alo Online reaches over 1 million people every day at home and abroad.</p><p>Beyond the border of Bangladesh Prothom Alo Weekly North America Edition is printed in New York and distributed to the expatriate Bangladeshis residing across the USA and Canada.</p>', 1, 1, 'Footer Menu', '2022-08-24 18:11:45', '2022-08-27 01:22:31'),
(2, 'Terms of Use', 'terms-of-use', '<h1><strong style=\"color: rgb(0, 97, 0);\"><u>Terms of Use                                 </u></strong></h1><p>We welcome readers and visitors to our “Terms of Use’ of Prothom Alo and its associated websites, its contents, services and applications. Individuals may access the content in several ways using multiple channels including but not limited to www, digital, social platforms, SMS and RSS feeds using multiple devices including but not limited to computers, mobile phones and PDAs. By using our content and services, that is , by reading or using any content, picture or information whatsoever, the reader/visitor accepts our “Terms of Use” including Prothom Alo’s <a href=\"https://prothomalo.com/privacy-policy\" rel=\"noopener noreferrer\" target=\"_blank\">Privacy Policy</a>. If anyone has any objection or reservation to any clause in this “Terms of Use” or the <a href=\"https://prothomalo.com/privacy-policy\" rel=\"noopener noreferrer\" target=\"_blank\">Privacy Policy</a>, she or he may raise the issue with Prothom Alo by sending an email at info@prothomalo.com. However, Prothom Alo reserves all right to reject or accept any such objection or reservation. All users of Prothom Alo are required to abide by this “Terms of Use”. Failure to comply with the terms may lead to, among others, suspension of account or prohibition from access to the website. By entering the website of Prothom Alo or using applications of Prothom Alo, readers/visitors are deemed to have received services from Prothom Alo. These services include text, audio, video, images, software etc.</p><h3>Intellectual Property Rights</h3><p>Prothom Alo’s content, logos, copyright, trademarks, patents, images, text, graphics, logos, domain names, audio, video and other related intellectual property rights or other features of Prothom Alo brand and name belong to Prothom Alo or to its licensors. Users cannot claim any rights in and/or our licensor’s intellectual property whether for commercial or non-commercial use. Users are also prevented from making any derivative work from the content of Prothom Alo. Infringement of copyright or any other intellectual property of Prothom Alo may be sent at info@prothomalo.com.</p><p><br></p><h2><strong>Your use of our services</strong></h2><p>Site readers/visitors are required to use Prothom Alo services only for lawful means and for read-only purposes. The audio and visual elements of the website or application can only be listened to and viewed and nothing beyond. Prothom Alo encourages its readers to share its content(s) in their social media profile, groups and related communities. However, the contents of our services must not be shared with anyone or with any other digital platforms with any modification or alteration. Readers/Visitors are prohibited from hacking the website, or trying to get around our content security setup.</p><p>The users must use the services only for non-commercial purposes, regardless of whether the person or entity is a commercial entity or not. We grant our users only a license to access and use our services and intellectual property rights subject to the following usage restrictions: users may use available services for personal, private and non-commercial purposes only, the users must not exploit, sell or use any content appearing on our services for any kind of commercial purposes (this does not apply to any user content posted by an individual and in which a visitor/user retains ownership rights), the users must not use provocative or offensive language, pictures or comments targeting the contents of Prothom Alo.</p><p><br></p><h2><strong>Taking down contents</strong></h2><p>Prothom Alo can take down contents at any time at its sole discretion from its website or application. Readers/Visitors cannot refuse to remove content, games or apps from their respective devices if asked by Prothom Alo. This might happen when Prothom Alo or its services are taken down.</p><h3>Unauthorized and prohibited activities</h3><p>The user is specifically required not to associate Prothom Alo with any political party, racism, sexism or otherwise damage its reputation. The user is also prohibited from defaming Prothom Alo or defaming any other person or entity, or commenting on any court proceedings that may amount to a contempt of court. Harassing, bullying or upsetting the people or any other user is strongly prohibited. The user must not post or upload any image or comment which is offensive or obscure or immoral. Personal attack by way of comment or image is likewise prohibited..</p><h3>Protection of Users Device</h3><p>Readers/Visitors are required to take their own precautions and protections in this respect as Prothom Alo does not accept any responsibility for any attacks by virus or malware or any other contamination or by anything which has destructive properties. Prothom Alo strictly does not hold any responsibility for infection of virus or contamination of your machine or device through your access to any third-party contents. Third party contents may include, but is not limited to Google ads. Any content which is not generated by Prothom Alo itself is a third-party content, regardless of whether the content appears on the website of Prothom Alo or not.</p><h3>Prohibition on sharing mark, contents, images, etc.</h3><p>Prothom Alo prohibits the users from sharing marks, contents or images for whatever purpose, be it commercial or not. When sharing of contents, images or marks are permitted or authorized, then such sharing must be done by attributing the credit and name to Prothom Alo in such manner that the attribution is clearly visible when the image or content is generated by Prothom Alo. All users are prohibited from taking credit from the contents or images shared, published or generated by Prothom Alo.</p><p><br></p><h2><strong>Redirecting to other Websites</strong></h2><p>Prothom Alo will not accept any kind of liability if the user is redirected to any other website including unwanted websites from the Prothom Alo.</p><h3>Third Party Contents</h3><p>Prothom Alo does not bear any responsibility or liability whatsoever for any third-party contents. Third party contents include such contents which are not generated or produced by Prothom Alo. It includes contents, images and texts which are uploaded or displayed by Prothom Alo but which are created or generated or produced by someone or entity other than Prothom Alo.</p><p><br></p><h2><strong>Privacy Policy</strong></h2><p>The entire <a href=\"https://prothomalo.com/privacy-policy\" rel=\"noopener noreferrer\" target=\"_blank\">Privacy Policy</a> of Prothom Alo is an integral part of the “Terms of Use”. All clauses in the <a href=\"https://prothomalo.com/privacy-policy\" rel=\"noopener noreferrer\" target=\"_blank\">Privacy Policy</a> are hereby incorporated by reference, except for the clauses which are similar or have the same meaning.</p><p><br></p><h2><strong>Advertisement</strong></h2><p>The advertisements included in the Prothom Alo website and mobile apps, are by third-party companies, which may collect information about users for which Prothom Alo shall bear no responsibility that may arise as a result of collecting and/or sharing the information with any other party. Prothom Alo shall not accept any liability that may arise as a result of any content of any advertisement that may appear on the Prothom Alo website.</p><p><br></p><h2><strong>Use of Cookies</strong></h2><p>Prothom Alo does not collect any user data based on cookies, nor does it store any sort of user information that may be personal to the user. If a third party associated with the Prothom Alo website collects user cookies upon your visit to the Prothom Alo website, Prothom Alo does not control the use of these cookies. Therefore, visitors/users should check the relevant third-party websites.</p><p>When users register with Prothom Alo, personal identity information is collected for authentication. The information Prothom Alo collects is not shared with any third party. However, Prothom Alo may use the information to send messages, information from Prothom Alo or any of its associated companies.</p>', NULL, 1, 'Footer Menu', '2022-08-24 18:27:17', '2022-08-24 18:33:13'),
(4, 'Contact Us', 'contact-us', '<h1><u style=\"color: rgb(0, 97, 0);\">Contact Us                                        </u></h1><h3><strong style=\"color: rgb(107, 36, 178);\">Head Office</strong></h3><p>Pragati Insurance Bhaban, 20-21, Karwan Bazar Dhaka 1215, Bangladesh</p><p>Office: 02 8180078-81, 02 55012201-09</p><p>Advertisement: 02 55012212 </p><p>Fax: 02 55012200, 02 55012211 </p><p>ePaper: +88 01708411997 (10am-6pm, Phone &amp; WhatsApp)</p><h3><br></h3><h3><strong style=\"color: rgb(107, 36, 178);\">Email</strong></h3><p><a href=\"mailto:info@prothomalo.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 153, 255);\">info@prothomalo.com</a></p><p> Print Ad Sales: <a href=\"mailto:ad@prothomalo.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 153, 255);\">ad@prothomalo.com</a></p><p> Digital Ad Sales: <a href=\"mailto:adsales@prothomalo.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 153, 255);\">adsales@prothomalo.com</a> </p><p> ePaper: <a href=\"mailto:epaper@prothomalo.com\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 153, 255);\">epaper@prothomalo.com</a></p><p><br></p><h3><span style=\"color: rgb(107, 36, 178);\">Web site</span></h3><p><a href=\"https://www.prothomalo.com\" rel=\"noopener noreferrer\" target=\"_blank\">prothomalo.com</a> </p><p><a href=\"https://epaper.prothomalo.com/login/landingpage?ReturnUrl=%2fHome%2fArticleView%3flogged_in%3dfalse&amp;logged_in=false\" rel=\"noopener noreferrer\" target=\"_blank\">epaper.prothomalo.com</a></p><p><br></p>', 2, 1, 'Footer Menu', '2022-08-25 00:24:24', '2022-08-25 00:32:17'),
(5, 'About Us', 'about-us', '<h1><strong style=\"color: rgb(0, 97, 0);\"><u>About Us   </u></strong><strong><u>                                        </u></strong></h1><p>4 November 1998. With the very first light of dawn, Prothom Alo (The First Light), started its humble journey. Because of its courageous journalism, rich content, and presentation with unique layout and design, Prothom Alo quickly won the hearts of people, even the most sophisticated and fastidious readers extended their loyalty toward it. Since then, Prothom Alo has been lighting up every nook and corner of Bangladesh along with 200 other countries and territories across the world through its print and digital offerings.</p><h2><span style=\"color: rgb(107, 36, 178);\">Values and Principles</span></h2><p>The most contributing factor behind the unparalleled popularity of Prothom Alo is the values and principles we adhere to:</p><ul><li><strong>Professional Journalism</strong></li><li> With exemplary courage, we practice transparent and objective journalism</li><li><strong>People Focus</strong></li><li> We talk of the people; we stand by the people</li><li><strong>Change Catalyst</strong></li><li> Every day we speak of positive change</li><li><strong>Innovation</strong></li><li> We look beyond the ordinary; we progress with innovation and uniqueness</li><li><strong>Integrity</strong></li></ul><p><br></p>', 1, 1, 'Header Menu', '2022-08-25 00:28:05', '2022-08-25 01:21:53'),
(6, 'Our values', 'our-values', '<h1><strong><u>Our values                                      </u></strong></h1><p>Our values were set out by CP Scott in his centenary leader in 1921. They are: honesty, integrity, courage, fairness, and a sense of duty to the reader and the community.</p><p><br></p><p>Our values and behaviours provide the basis of how we work together, how we communicate and what we should expect from each other. </p><p>•&nbsp;We foster a supportive and open culture&nbsp;</p><p>•&nbsp;We are curious and innovative, prepared to fail and willing to learn</p><p>•&nbsp;We embrace diversity, champion inclusivity and treat everyone with respect</p><p>•&nbsp;We strive for excellence to pursue the best interests of our audience and our colleagues</p><p>•&nbsp;We stand up for what we believe is right, not what is easy</p>', NULL, 1, 'Header Menu', '2022-08-25 00:31:56', '2022-08-25 00:31:56');

