(1, 8, 7, 'Ageing population: Are we ready to ensure their proper care?', 'ageing-population-are-we-ready-to-ensure-their-proper-care', '<p><img src=\"data:image/png;base64,\"></p><p>The country\'s population is still predominantly young, but a sharp increase in the proportion of those over 60 years of age could leave it ill-prepared to provide them with care.The number of people in the age group in the latest census was over 1.53 crore, which is around 9.28 percent of the total population of 16.51 crore. In the 2011 census, this group constituted 7.48 percent of the population.</p>', 'data:image/png;base64,', 1, 1, 1, 1, 25, '2022-08-20 03:18:57', '2022-08-27 01:13:13');
INSERT INTO `posts` (`id`, `cat_id`, `tag_id`, `title`, `slug`, `content`, `image`, `featured`, `breaking_news`, `status`, `user_id`, `view`, `created_at`, `updated_at`) VALUES
(2, 8, 13, 'Lorem Ipsum', 'lorem-ipsum', '<h1><img src=\"data:image/png;base64,\"></h1><p><br></p><p><strong class=\"ql-size-huge\"><em>M</em></strong>ongla, the country’s second largest sea port, saw huge activities during the last two months, after the inauguration of the Padma Bridge.</p><p>Huge machineries, equipment, raw materials of some mega projects including Rooppur Nuclear Power Plant, Rampal Power Plant, metro rail, Bangabandhu and Khanjahan Ali railway bridges and huge imported cars have so far been unloaded through the port during last 50 days, an official of the port authority said.</p><p>Huge readymade garment items, shrimp, vegetables, fruits and other items have already been exported during last two months through this port, the official said.</p><p><br></p><p>Md Makruzzaman, secretary to the Mongla Port Authority (MPA) said that Mongla Port has turned into an international standard port following huge modernization projects.</p><p>A total of 896 foreign ships have so far been anchored at the port jetty in 2021-22 fiscal year (FY).</p><p>“A total of 60 per cent imported cars came through this port during last two months, capability of cargo handling has been increased several times compared to previous months and the businessmen have been showing their keen interest to use this port as distance between Dhaka to Mongla now stands only at 170 kilometers while Dhaka to Chattogram stands at 260 kilometers,” he said.</p><p>Huge development activities including dredging are going on and 9.5 to 10 meter wide ship is capable of anchoring at the Mongla Port jetty, he said adding that a vested quarter is now trying to stop the dredging activities at Mongla Port inner channel in a bid to obstruct development activities of the government.</p><p>He, however, said foreign ships between 9.5 meters to 10.0 meters wide are now capable of anchoring at the Harbaria, entry point of the Mongla Port jetty near the Bay of Bengal, also known as outer bar, after completion of dredging.</p><p>But, the MPA are now facing trouble to complete 23.4 kilometers inner bar dredging from Harbaria dredging area to port jetty as a vested quarter has obstructed to keep sands at the river side during the Pashur River dredging.</p><p>When contacted, chairman of the Mongla Port Authority Rear Admiral Mohammad Musa said that government has taken many initiatives to enhance the ability of the Mongla Sea Port.</p><p>“The port sees the arrival of record number of foreign ships due to the intervention of prime minister Sheikh Hasina, special directives from the shipping ministry, cooperation by Mongla Port users and hard works by the employees of the organisation,” he said.</p><p>Number of foreign ships in the port has been increasing day by day after inauguration of the Padma Bridge and industrialisation boosted up in the area centering Padma Bridge, Mongla Port and Rampal Power Plant.</p><p>Investors are importing different production materials like machineries, cement clinkers, cars, fertilizers and equipment for industrialization, he added.</p>', 'data:image/png;base64,', 1, 1, 1, 1, 1, '2022-08-21 02:13:50', '2022-08-23 05:13:52');
INSERT INTO `posts` (`id`, `cat_id`, `tag_id`, `title`, `slug`, `content`, `image`, `featured`, `breaking_news`, `status`, `user_id`, `view`, `created_at`, `updated_at`) VALUES
(3, 40, 19, 'Taiwan saw off China before and resolve to defend remains, president says', 'taiwan-saw-off-china-before-and-resolve-to-defend-remains-president-says', '<p><img src=\"data:image/png;base64,\"></p><p><br></p><h1><strong class=\"ql-size-huge\"><em>T</em></strong>aiwan saw off China’s military six decades ago when its forces bombarded offshore Taiwanese islands and that resolve to defend the homeland continues to this day, President Tsai Ing-wen told a visiting group of US academics on Tuesday.</h1><p>Tensions between Taiwan and China have spiked over the past month following the visit to Taipei by US House Speaker Nancy Pelosi. China staged war games near Taiwan to express its anger at what it saw as stepped up US support for the island Beijing views as sovereign Chinese territory.</p><p>Meeting the delegation from Stanford University’s Hoover Institution at her office, Tsai referenced China’s month of attacks on the Taiwan-controlled islands of Kinmen and Matsu that sit off just off the Chinese coast which started in August 1958.</p><p><br></p><p>“Sixty-four years ago during the 23 August battle, our soldiers and civilians operated in solidarity and safeguarded Taiwan, so that we have the democratic Taiwan today,” she said, using the common Taiwanese term for that campaign, which ended in stalemate with China failing to take the islands.</p><p>“That battle to protect our homeland showed the world that no threat of any kind could shake the Taiwanese people’s resolve to defend their nation, not in the past, not now, and not in the future,” Tsai added.</p><p>“We too will show the world that the people of Taiwan have both the resolve and confidence to safeguard peace, security, freedom and prosperity for ourselves.”</p><p>In 1958, Taiwan fought back with support from the United States, which sent military equipment like advanced Sidewinder anti-aircraft missiles, giving Taiwan a technological edge.</p><p>Often called the Second Taiwan Strait Crisis, it was the last time Taiwanese forces joined battle with China on a large scale.</p><p>The United States, which ditched formal diplomatic relations with Taipei in favour of Beijing in 1979, remains Taiwan’s most important source of arms.</p><p>“As Taiwan stands on the front line of authoritarian expansionism we continue to bolster our defence autonomy, and we will also continue to work with the United States on this front,” Tsai said.</p><p>China’s drills near Taiwan have posed a threat to the status quo in the strait and across the region, and democratic partners should work together to “defend against interference by authoritarian states”, she added.</p><p>Taiwan’s government says that as the People’s Republic of China has never governed the island it has no right to claim it or decide its future, which can only be set by Taiwan’s 23 million people.</p>', 'data:image/webp;base64,', 1, 0, 1, 1, 1, '2022-08-23 05:09:11', NULL);
INSERT INTO `posts` (`id`, `cat_id`, `tag_id`, `title`, `slug`, `content`, `image`, `featured`, `breaking_news`, `status`, `user_id`, `view`, `created_at`, `updated_at`) VALUES
(4, 40, 19, 'Pakistan court to weigh contempt action against former PM Khan', 'pakistan-court-to-weigh-contempt-action-against-former-pm-khan', '<p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong class=\"ql-size-huge\"><em>A</em></strong> court in Pakistan will consider taking action on Tuesday against former prime minister Imran Khan on grounds of contempt, following a weekend speech in which he threatened police officers and a judicial magistrate, officials said.</p><p>The issue could be a threat for Khan, who has been campaigning for new elections since being forced to step down this year, since a conviction would disqualify him from standing for election, legal experts said.</p><p>“It is a criminal conviction,” a retired judge, Shaiq Usmani, told television channel Geo News, adding that Khan could face six months in jail if convicted. “Due to it, he cannot contest any election for five years.”</p><p><br></p><p>The South Asian nation has seen at least one prime minister, and some law makers, unseated after such disqualifications.</p><p>The contempt issue is in addition to charges under an anti-terror law that police filed against Khan over what they said was a threat in his speech about an aide who faces sedition charges for inciting mutiny in the military. Read full story.</p><p>“We will not spare you,” Khan said in the speech that named the police chief and the judge involved in the case against the aide. “We will sue you.”</p><p>The use of anti-terrorism laws as the grounds for cases against political leaders is not uncommon in Pakistan, where Khan’s government also used them against opponents and critics.</p><p>His political party, the Pakistan Tehreek-e-Insaf (PTI), has dismissed the accusations against Khan as being politically motivated, saying they were being used to block him from leading anti-government rallies. Read full story</p><p>The prime minister from 2018 until losing a confidence vote in parliament in April, Khan came to power with what political analysts said was the support of the military, on a conservative agenda that appealed to many middle-class and religious voters.</p><p>But analysts said he fell out with the military after a dispute over the appointment of a spy chief.</p><p>Khan denied ever having military support and the military, which has ruled Pakistan for more than three decades of its 75-year history, denies involvement in civilian politics.</p>', 'data:image/png;base64,', 0, 0, 1, 1, 1, '2022-08-23 12:38:40', NULL);
INSERT INTO `posts` (`id`, `cat_id`, `tag_id`, `title`, `slug`, `content`, `image`, `featured`, `breaking_news`, `status`, `user_id`, `view`, `created_at`, `updated_at`) VALUES
(5, 40, 18, 'US \'deeply concerned\' about violence on Syria-Turkey border', 'us-deeply-concerned-about-violence-on-syria-turkey-border', '<p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong class=\"ql-size-huge\"><em>W</em></strong>ashington is \"deeply concerned\" about a recent flare-up of violence along Syria\'s northern border with Turkey, a State Department spokesman said Monday.</p><p>\"The United States is deeply concerned about recent attacks along Syria\'s northern border and urges all parties to maintain ceasefire lines,\" said spokesman Ned Price, days after increased bombardments in the area reportedly killed at least 21 civilians -- including children.</p><p>\"We deplore the civilian casualties in Al-Bab, Hasakah, and elsewhere,\" said Price, adding that the United States remained committed \"to ensure the enduring defeat of ISIS and a political resolution to the Syrian conflict.\"</p><p>The recent bloodshed came against a backdrop of increased tensions pitting the Kurdish-led Syrian Democratic Forces (SDF) against Turkish troops and their Syrian proxies.</p><p><br></p><p>On Friday, Kurdish authorities said that a pre-dawn strike by a Turkish drone hit \"a training centre for young girls\" in the Shmouka area near Hasakeh in the northeast, killing four children and wounding 11.</p><p>The Britain-based Syrian Observatory for Human Rights, a war monitor with a broad network of sources on the ground, confirmed the toll.</p><p>In Al-Bab, a town under the control of Syrian factions loyal to Ankara, \"artillery fire on a market by pro-regime forces killed 17 civilians -- including six children -- and wounded another 35,\" the Observatory said.</p><p>An AFP correspondent said the strike on the town near the Syria-Turkey border had ripped through a market, describing it as a jumble of body parts, strewn vegetables and mangled handcarts.</p>', 'data:image/png;base64,', 0, 0, 1, 1, 1, '2022-08-23 12:42:57', NULL);
INSERT INTO `posts` (`id`, `cat_id`, `tag_id`, `title`, `slug`, `content`, `image`, `featured`, `breaking_news`, `status`, `user_id`, `view`, `created_at`, `updated_at`) VALUES
(6, 40, 18, 'Israel troops raid Palestinian rights group offices', 'israel-troops-raid-palestinian-rights-group-offices', '<p><img src=\"data:image/png;base64,\"></p><p><br></p><p><strong class=\"ql-size-huge\"><em>I</em></strong>sraeli security forces on Thursday raided the offices of multiple Palestinian human rights groups in the occupied West Bank, which the state has branded \"terrorist organisations\".</p><p>The military said soldiers and police officers \"closed seven institutions and confiscated property\" in the overnight raids.</p><p>At the Ramallah offices of human rights group Al Haq, the front door had been welded shut and a Hebrew statement left saying it would remain closed for \"security reasons\".</p><p>\"Any activity in this place jeopardises the security of the area, of the security forces and of public order,\" said a statement seen by AFP.</p><p>Al Haq is one of six Palestinian groups branded terrorist organisations by Israel in October for their alleged links to leftist militant group the Popular Front for the Liberation of Palestine (PFLP).</p><p><br></p><p>Israel has not publicly shared any evidence of the alleged ties to the PFLP, which has been labelled a terrorist organisation by many Western governments.</p><p>Last month, nine European countries said they would continue to cooperate with the six groups, after \"no substantial information\" was received from Israel to justify their terror designation.</p><p>Staff from Al Haq removed the metal sheet covering their office door on Thursday and vowed to continue working, despite computers and other equipment being seized.</p><p>On Thursday morning, tear gas canisters littered the street outside Al Haq\'s office. The Israeli military said it responded to \"rocks and Molotov cocktails\" being thrown at soldiers during the overnight raids.</p><p>West Bank cities are nominally under the full control of the Palestinian Authority but the Israeli security forces carry out frequent incursions, which are often met with stones or petrol bombs.</p><p>In a tweet, senior Palestinian Authority official Hussein al-Sheikh described the raids as \"an attempt to silence the voice of truth and justice\".</p><p>They come after Israeli Defence Minister Benny Gantz announced on Wednesday that the terror designation of three of the groups had passed into law.</p><p>The other three, which had challenged their terror designations, had their appeals rejected, a statement from Gantz\'s office said.</p><p>Israeli forces additionally raided the offices of a seventh organisation -- the Union of Health Work Committees -- which was banned by Israel from working in the West Bank in 2020.</p>', 'data:image/png;base64,', 0, 0, 0, 1, 0, '2022-08-23 12:48:55', '2022-08-26 15:14:17');

